package com.pjindal.graphs;

public class Pair {
	private int first;
	private int second;

	public Pair() {
		// TODO Auto-generated constructor stub
	}

	public Pair(int first, int second) {
		super();
		this.first = first;
		this.second = second;
	}

	public int getFirst() {
		return first;
	}

	public void setFirst(int first) {
		this.first = first;
	}

	public int getSecond() {
		return second;
	}

	public void setSecond(int second) {
		this.second = second;
	}
}
